	public String cargarArchivo(String nombreArchivo) {

		String respuestaServicio = null;
		HttpURLConnection conn = null;
		log.info("nombreArchivo: " + nombreArchivo);

		try {
			
			AutorizacionLogica autorizacionLogica = new AutorizacionLogica();
			String token = "Bearer " + autorizacionLogica.generarToken();
			
			// Sending get request
		    URL url = new URL("https://graph.microsoft.com/v1.0/drives/b!iJ7pOkEBEEKQbLWZgKh9HrBFKAmRHVVJhnoZ19hyTvacF-kWeWcPQoVq6USsJWJt/root:/General/" + nombreArchivo + ".docx:/content");
		    
		    conn = (HttpURLConnection) url.openConnection();
		    conn.setDoOutput(true);
		    conn.setRequestProperty("Accept", "application/json");
		    conn.setRequestProperty("Authorization",token);
		    conn.setRequestProperty("Content-Type", "application/json");	//application/x-www-form-urlencoded    
		    conn.setRequestMethod("PUT");

		    String contenido = "";
		    byte[] decodedString = Base64.getDecoder().decode(new String(contenido).getBytes("UTF-8"));
		    conn.getOutputStream().write(decodedString);

		    //out.write("Resource content");
		    
		    BufferedReader in = new BufferedReader(new InputStreamReader(conn.getInputStream()));
		    String output;

		    while ((output = in.readLine()) != null) {
		        respuestaServicio = output.toString();
		    }
		    
		   	conn.disconnect();
		   	in.close();
		} catch (Exception e) {
			log.error("Error: " + e.getMessage());
			respuestaServicio = e.getMessage();			
		}

		return respuestaServicio;
	}
	
